  false,\n\t\"url\": null,\n\t\"notes\": \"This is an Arc/Info coverage consisting
  of 4 arcs representing the portion of The Rim Trail at Pipe Spring National Monument,
  Arizona that occurs within the National Register of Historic Places district. It
  is also referred to as the Quarry Trail. The Rim Trail was collected by a Trimble
  GeoXT GPS unit with external antenna, Hurricane, and post processed in GPS Pathfinder
  Office 3.0 for differential corrections. This feature is referenced by the 2000
  National Register of Historic Places, Nomination Update (August 14, 2000). Located
  on the map: Pipe Spring National Monument Historic District (prepared by: Kathy
  McKoy, NPS, June 2000 detail; revised Existing Conditions map, Landscape Systems,
  1997). It is a contributing feature.\",\n\t\"license_title\": null,\n\t\"extras\":
